import './intro.css';
const Intro = () => {
  return (
    <section id ="intro">
   <div className='intro content' >
        <h3>Hello</h3><h2>I'M Pranesh Katariya</h2><h2>Web Devloper</h2>
    <p>I am skilled and a passionate web Devloper</p>
    </div>
    </section> 
    )
}

export default Intro
